;; gorilla-repl.fileformat = 1

;; **
;;; # Simple Image Rotations
;;; 
;;; > In this recipe we learn how to create a 2x2 image of all the possible simple rotation of an image using OpenCv rotate function.
;; **

;; @@
(ns fluttering-fern
  (:require
    [opencv3.utils :as u]
    [opencv3.core :refer :all]))

(defn center-crop[img dest]
  (let[
    w (cols img)
    h (rows img)
    s (clojure.core/min w h)
    rect (new-rect
      (- (/ w 2) (/ s 2))
      (- (/ h 2) (/ s 2))
      s
      s)]
      (copy-to (submat img rect) dest)))

(defn center-crop![src]
  (center-crop src src)
  src)

(defn rotation-collage[img0]
  (let[
    img1 (-> img0 clone center-crop!)
    img2 (-> img0 clone (rotate! ROTATE_90_CLOCKWISE) center-crop!)
    img3 (-> img0 clone (rotate! ROTATE_180) center-crop!)
    img4 (-> img0 clone (rotate! ROTATE_90_COUNTERCLOCKWISE) center-crop!)
    ]
    (vconcat! [(hconcat! [img4 img2])
               (hconcat! [img3 img1])] )))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fluttering-fern/rotation-collage</span>","value":"#'fluttering-fern/rotation-collage"}
;; <=

;; @@
(-> 
  "resources/images/cat.jpg" 
  (imread)
  (u/resize-by 0.15)
  (rotation-collage )
  (u/mat-view))
